@Test
  public void prependTo_prependsProperSql() {
    /* Given */
    CreateImpl create = new CreateImpl();
    RawSqlBuilder builder = new RawSqlBuilderImpl();

    /* When */
    create.prependTo(builder);

    /* Then */
    assertThat(builder.toString(), is("CREATE"));
  }

